import React, { Component } from 'react';

class Lol extends Component {
    render () {
        let {mot} = this.props;
        return (
        <div>
            <h2>Ceci est un {mot}</h2>
        </div>)
    }
}

Lol.defaultProps = {
    mot: "coucou"
  };

export default Lol
